import React from "react";
import { useGetNotesQuery } from "./notesApiSlice";

const NotesList = () => {
  const {
    data: notes,
    data: users,
    isLoading,
    isSuccess,
    isError,
    error,
  } = useGetNotesQuery();

  let content;

  // Loading state
  if (isLoading) content = <p>Loading...</p>;

  // Error state
  if (isError) {
    content = (
      <p className={isError ? "errmsg" : "offscreen"}>{error?.data.message}</p>
    );
  }

  return (
    <div>
      <h1>NotesList</h1>
    </div>
  );
};

export default NotesList;
